import React from "react";
import { Layout } from "antd";
const { Content } = Layout;
const Contents = () => {
  return (
    <Content style={{ margin: "2em 16px" }}>
      <div style={{ background: "#fff", padding: 24, minHeight: 280 }}></div>
    </Content>
  );
};

export default Content;
